;(function($){
	jQuery.fn.extend({
        // 判断是否为空或者全是空格
        "isNull":function(){
            value = $(this).val();
            if ( value == "" ) return true;
            var regu = "^[ ]+$";
            var re = new RegExp(regu);
            return re.test(value);
        },
		//检测手机
		"check_phone":function(){
            var r=new RegExp(/^(((13\d|14[57]|15[^4,\D]|17\d|18\d)\d{8}))$/);
            var value=$(this).val();
            var result=r.test(value);
           return result;
		},
		//检测邮箱
		"check_email":function(){
            var r=new RegExp(/^[a-z\d]+(\.[a-z\d]+)*@([\da-z](-[\da-z])?)+(\.{1,2}[a-z]+)+$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
		},
		//检测身份证
		"check_idcard":function(){
            var r=new RegExp(/^[1-9]{1}[0-9]{14}$|^[1-9]{1}[0-9]{16}([0-9]|[xX])$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
		},
		//检测姓名
		"check_name":function(){
            var r=new RegExp(/^([\u4e00-\u9fa5]){2,7}$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
		},
		//检测用户名
		"check_username":function(){
            var r=new RegExp(/^[a-z0-9_-]{3,16}$/);
            var value=$(this).val();
            var result=r.test(value);
           return result;
		},
		//检测url
		"check_url":function(){
            var r=new RegExp(/^(https?:\/\/)?([\da-z\.-]+)\.([a-z\.]{2,6})([\/\w \.-]*)*\/?$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
		},
		//检测密码(以字母开头，长度在6~18之间，只能包含字符、数字和下划线)
        "check_password":function(){
            var r=new RegExp(/^[a-zA-Z]\w{5,17}$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
        },
		// 检测密码一致
		"check_password_alike":function(className){
            var thisvalue=$(this).val();
            var formervalue=$(className).val();
            if(thisvalue==formervalue){
                return true;
            }else if(thisvalue!==formervalue){
                return false;
            }
		},
		//检测ip地址
		"check_ip":function(){
            var r=new RegExp(/^[a-z0-9_-]{6,18}$/);
            var value=$(this).val();
            var result=r.test(value);
            return result;
		},
        // 检测固话号码
        "check_tele":function(){
            var r=new RegExp(/^((0\d{2,3}-\d{7,8}))$/);
            var value=$(this).val();
            var result=r.test(value);
            // console.log(result)
            return result;
        },
        // 检测手机和固话
        "check_telephone":function(){
            var r=new RegExp(/^((0\d{2,3}-\d{7,8})|(1[3584]\d{9}))$/);
            var value=$(this).val();
            var result=r.test(value);
            console.log(result)
            return result;
         
        },
		// ***********************
		// ***********************
		// 验证码按钮事件
		// 默认为60秒后重新发送
		// 条件允许后（比如手机号码格式正确了）就调用$(".verification-code").verify();
        // wait_s：秒数
		// ***********************
		// ***********************
		"verify":function(wait_s){
			 // 验证码按钮事件
	        var wait=wait_s;
            var ojc=this;

	        if(!($(ojc).hasClass("on"))){
                time();
            }

	        function time(){

	            if(wait<wait_s){

	                clearInterval(times);
	            }
	            if(wait===0){
                    $(ojc).removeClass("on");
	                $(ojc).text("重新发送");
	                wait=wait_s;

	            }else{
	           
                    $(ojc).addClass("on");
	                $(ojc).text("重新发送("+wait+"s)");
	                wait--;

	                times=setInterval(time,1000);
	            }
	        };
		},
	});
})(jQuery);

$(function(){


    // 顶部栏 菜单点击
    $('.nav-btn').click(function(){
        showLog({
        	content:$('.nav-menu').html(),
        	show: function(){
	$('.nav-box .rule').click(function(){
        	var index = $(this).attr('data-index');
        	$('.nav-dialog').remove()

        	if (index == 1) {
        		// 《条款与细则》
        		showLog({
        			content: $('.win1').html(),
        			type: 2
        		});
        	}else if (index == 2) {
        		// 《个人资料和cookies政策》
        		showLog({
        			content: $('.win2').html(),
        			type: 2
        		});
        	}else if (index == 3) {
        		// 《请理性享用轩尼诗干邑》
        		window.location.href= "http://www.responsibledrinking.eu/"
        	}	
	})
        	}
        });
    });

})

// 条款弹窗样式布局
var rule_dialog = 
		'<div class="win-box">' +
			'<div class="tit"></div>' +
			'<div class="txt"></div>' +
		'</div>';


////////
// 弹窗 //
// 
// param: obj 	可包含以下内容
// 								1 content： 弹窗内容
// 								2 type   ： 弹窗类型
// 								3 yes    ： 按钮的回调函数
// 								4 show   ： 当弹窗显示到屏幕上后的回调
// 				
// type： 1/2	1 的关闭按钮较大； 2 的关闭按钮较小； 3 为信息提示弹窗； 4 为一半高度的弹窗
////////
function showLog(obj){
	// content, type, callback
	var that = this;
	var content = obj.content || "";
	var type = obj.type || 1;
	var html;

	if (type == 1) {
		html = 
			'<div class="nav-dialog">' +
	            '<a href="javascript:;" class="dialog-close-1 dialog-close"></a>' +
	            '<div class="dialog-con">' +
	            	'<div class="dialog-box">' +
		                content +
	                '</div>' +
	            '</div>' +
	        '</div>';
	}else if (type == 2) {
		html = 
			'<div class="nav-dialog">' +
	            '<div class="dialog-con">' +
		            '<a href="javascript:;" class="dialog-close-2 dialog-close"></a>' +
	            	'<div class="dialog-box">' +
		                content +
	                '</div>' +
	            '</div>' +
	        '</div>';
	}else if (type == 3) {
		html = 
			'<div class="nav-dialog">' +
	            '<div class="dialog-con dialog-mess-box">' +
		            '<a href="javascript:;" class="dialog-close-2 dialog-close"></a>' +
	            	'<div class="dialog-box mess-box">' +
		                content +
	                '</div>' +
	                '<a href="javascript:;" class="dialog-btn">知道了</a>'
	            '</div>' +
	        '</div>';
	}else if (type == 4) {
		html = 
			'<div class="nav-dialog">' +
	            '<div class="dialog-con dialog-half-box">' +
		            '<a href="javascript:;" class="dialog-close-2 dialog-close"></a>' +
	            	'<div class="dialog-box mess-box">' +
		                content +
	                '</div>' +
	            '</div>' +
	        '</div>';
	}

	// 将弹窗添加进页面
	$('body').append(html);
	$('body').addClass('fixed')

	// 关闭弹窗时的动画
	$('.dialog-close').click(function(){
		$('.nav-dialog').removeClass('show');
		setTimeout(function(){
			$('.nav-dialog').remove()
		}, 600)
		// 页面禁止滑动
		$('body').removeClass('fixed')
	})

	// 添加入场动画 在加载完之后执行
	setTimeout(function(){
		$('.nav-dialog').addClass('show');
	}, 20)

	// 按钮回调函数
	$('.dialog-btn').click(function(){
		try{
			obj.yes()
		}catch(e){}

		$('.dialog-close').click()
	})

	// 弹窗显示后的回调
	if($('.nav-dialog').length > 0){
		try{
			obj.show()
		}catch(e){}
	}

}
